DROP PROCEDURE IF EXISTS `replaceMonth`;
DROP TABLE IF EXISTS `cron_log`;
CREATE TABLE `cron_log` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `coupon_id` int(11) DEFAULT NULL,
  `title` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `content` varchar(500) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DELIMITER ;;

CREATE DEFINER = `root`@`localhost` PROCEDURE `replaceMonth`()
BEGIN
   SET
      SESSION time_zone = '+02:00';
SET
   @months = '"Janvier","Février","Mars","Avril","Mai","Juin","Juillet","Août","Septembre","Octobre","Novembre","Décembre"';
-- Anh "January","February","March","April","May","June","July","August","September","October","November","December"
-- Đức "Januar","Februar","März","April","Mai","Juni","Juli","August","September","Oktober","November","Dezember"
-- TBN "Enero","Febrero","Marzo","Abril","Mayo","Junio","Julio","Agosto","Septiembre","Octubre","Noviembre","Diciembre"
-- Ý "Gennaio","Febbraio","Marzo","Aprile","Maggio","Giugno","Luglio","Agosto","Settembre","Ottobre","Novembre","Dicembre"
-- BDN "Janeiro","Fevereiro","Março","Abril","Maio","Junho","Julho","Agosto","Setembro","Outubro","Novembro","Dezembro"
SET
   @currentMonth = SUBSTRING_INDEX(SUBSTRING_INDEX(@months, ", ", MONTH(CURRENT_DATE)), ", ", - 1) COLLATE utf8_unicode_ci;
IF MONTH(CURRENT_DATE) = 1
THEN
   SET
      @previousMonth = SUBSTRING_INDEX(SUBSTRING_INDEX(@months, ", ", 12), ", ", - 1) COLLATE utf8_unicode_ci;
ELSE
   SET
      @previousMonth = SUBSTRING_INDEX(SUBSTRING_INDEX(@months, ", ", MONTH(CURRENT_DATE) - 1), ", ", - 1) COLLATE utf8_unicode_ci;
END
IF;
TRUNCATE TABLE `cron_log`;

INSERT INTO cron_log(coupon_id, title, content, create_time)
SELECT id AS coupon_id,
       title,
       content,
       NOW() AS create_time
FROM coupon
WHERE title LIKE CONCAT('%', REPLACE(@previousMonth, '"', ''), '%')
  OR content LIKE CONCAT('%', REPLACE(@previousMonth, '"', ''), '%') ;


UPDATE coupon
SET title = REPLACE(title, REPLACE(@previousMonth, '"', ''), REPLACE(@currentMonth, '"', '')),
    content = REPLACE(content, REPLACE(@previousMonth, '"', ''), REPLACE(@currentMonth, '"', ''))
WHERE title LIKE CONCAT('%', REPLACE(@previousMonth, '"', ''), '%')
  OR content LIKE CONCAT('%', REPLACE(@previousMonth, '"', ''), '%');

END;;

DELIMITER ;

